import React from 'react';
import './style/App.css';
import Login from './components/Login'
import Cadastro from './components/Cadastro'

let rota = 'Cadastro'

function alterarRota (value) {
    rota = value
    console.log(rota)
}


function App() {
    if (rota === 'Login') {
        return <Login onCadastrar={event => alterarRota('Cadastro')}/>;
    } else if (rota === 'Cadastro') {
        return <Cadastro/>;
    }
}

export default App;
